// StaffRoot.js
import React from "react";
import { Outlet } from "react-router-dom";
import StaffsNavigation from "../components/StaffsNavigation";
import classes from "./StaffRoot.module.css";

function StaffRoot() {
  return (
    <>
      <StaffsNavigation />
      <main className={classes.content}>
        <Outlet />
      </main>
    </>
  );
}

export default StaffRoot;
